    const[task, setTask] = useState(updateTask(props.name));
    
    function updateTask(per) {
        fetch('https://mypew.ru/php/table.php', {
            method: 'POST',
            header: {
                'Accept': 'application/json',
                'Content-Type': 'application/json',
            },
            body: JSON.stringify({
                table : 3,
                date : per,
                day_count: 1,
            })
        })
        .then (res => res.json())
        .then ((response) => {
            console.log(response);
            return (response)
        })
      }
  return (
    <div>{props.name}{typeof(task) != "undefined" && (task.map((i) => (console.log(i.title))))}</div>
  )
}
